import React from "react";
import Header from "../commons/Header/Header";
// import {BrowserRouter as Router} from 'react-router-dom'
import Footer from "../commons/Footer/Footer";
import './homePage.css';

function HomePage() {
  return (
    <div className="main">
      <Header />
      <h1 className="homepage-header">Star Wars fanpage</h1>

      <p>Please verify your age: </p>
      <button>I declare, that I am 16 years or older</button>
      <button>I am under 16 years of age</button>
      <Footer />
    </div>
  );
}

export default HomePage;
